function SetCookie(a, c) {
  var d = new Date();
  d.setTime(d.getTime() + (0.5 * 60 * 60 * 1000));
  var b = window.location.host;
  if (b.indexOf("eyun.cn") != -1) {
    document.cookie = a + "=" + encodeURIComponent(c) + ";domain=.eyun.cn;path=/"
  } else {
    document.cookie = a + "=" + encodeURIComponent(c) + ";path=/"
  }
}

function GetCookie(d) {
  var b = d + "=";
  var f = b.length;
  var a = document.cookie.length;
  var e = 0;
  while (e < a) {
    var c = e + f;
    if (document.cookie.substring(e, c) == b) {
      return getCookieVal(c)
    }
    e = document.cookie.indexOf(" ", e) + 1;
    if (e == 0) {
      break
    }
  }
  return null
}

function getCookieVal(b) {
  var a = document.cookie.indexOf(";", b);
  if (a == -1) {
    a = document.cookie.length
  }
  return decodeURIComponent(document.cookie.substring(b, a))
}

function DeleteCookie(b) {
  var a = new Date();
  a.setTime(-1000);
  var c = window.location.host;
  if (c.indexOf("eyun.cn") != -1) {
    document.cookie = b + "=; expires=" + a.toGMTString() + ";domain=.eyun.cn;path=/";
    document.cookie = b + "=; expires=" + a.toGMTString() + ";path=/"
  } else {
    document.cookie = b + "=; expires=" + a.toGMTString() + ";path=/"
  }
}

