function invalidStatus(c) {
  var a = c.status;
  var d = c.info;
  if (a == undefined) {
    var b = c.userdata;
    if (b != undefined) {
      a = b.status;
      d = b.info
    }
  }
  if (a == 2) {
    logout()
  }
  return true
}

function checkPhone(a) {
  return /^1[3456789]\d{9}$/.test(a)
}

function checkMail(a) {
  return /^(\w-*\.*)+@(\w-?)+(\.\w{2,})+$/.test(a)
};
